(1480, 1469, 'Four friends take a cottage vacation in the dead of winter, seeking refuge from their busy urban lives, if only for one weekend. However, the few residents who remain in the secluded cottage town of Rideau Ferry don’t seem to take kindly to strangers… From the moment they reach their destination, the visitors, a group of twenty-something artist types, are confronted by the ominous gaze of neighbouring cottagers, all of whom have no choice but to tough out the cold winter in this small, rural town. Over the course of their stay, the friends begin to uncover dark details about the inhabitants of the houses around them. After one of the friends is found mutilated on the front porch of a nearby cottage, the friends quickly discover that nothing is what it seems.', '2021-02-16', 'Matt Smith,David Kuyek,Tara Desmond,Brett Howie,Tracy Butler', 'Canada', 'Gravitas Ventures,Good House', 'https://www.youtube.com/embed/', 'Watch Death Trip Online Free,Death Trip Online Free,Where to watch Death Trip,Death Trip movie free online,Death Trip free online', 'https://img.himovies.to/resize/1280x768/db/37/db370f6a029ed30df450804cb87d17a3/db370f6a029ed30df450804cb87d17a3.jpg', 'Horror,Thriller', '2021-02-17 08:54:02', '2021-02-17 08:54:02'),
